import React from 'react'

const VideoItem = (props) => {
    return (
        <div>
            <img src = {props.video.snippet.thumbnails.default.url} alt={props.video.snippet.title} />
            Video Item: {props.video.snippet.title}
        </div>
    )
}

export default VideoItem
